import React, {Component} from "react"
import styled from 'styled-components'


class Divvy extends Component {
    render(){
        return (
          <div>
            <Head>Divvy Case Study</Head>
            <h4>Designing an app that will encourage Gen Z users to keep track of money usage</h4>




          </div>
        );
        }
}
export default Divvy;
const Head = styled.text`
  allign: inline-block;
  color: #4F4F4F;
  margin-left: auto;
  margin-right: auto;
  width: 20%;
  font-size: 3vw;
  padding: 3vw;
`
